import './Cell.css';

function Cell(props) {

    return (
        <div className={props.extClass}>
            <div className='hours'></div>
            <div className='text'>
                <span>PJF</span>
            </div>
            <div className='percentage'></div>
        </div>
    )
}

Cell.defaultProps = {    
    extClass: "cell"
  }

export default Cell;
